import React from 'react'
import "./Sidebar.css"
function Sidebar() {
    return (
        <div className="sidebar">
            <img
                className="sidebar__logo"
                src="https://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg"
                alt=""
            />
            <h1> Sidebar bar  </h1>
        </div>
    )
}

export default Sidebar;
